import React from "react";
import hello from "./hello.png";
import "./LoginPage.css";

const LoginPage = () => {
  return (
    <div className="Login-component">
      <div className="Login-text"> LOGIN</div>
      <img className="Hello" src={hello} alt="" />
    </div>
  );
};

export default LoginPage;

